INSERT INTO `productos` (`id_producto`, `nombre_producto`, `descripcion_producto`) VALUES
                                                                                       (1, 'Aplicación de monitorización', 'La aplicación de monitorización para huertos hidropónicos es una herramienta indispensable para aquellos que buscan controlar y optimizar el crecimiento de sus plantas en un ambiente controlado. Con esta aplicación, podrás supervisar el estado de tus'),
