                                                                                       (3, 'Sistema de ampliación', 'El sistema de ampliación para huertos hidropónicos es la solución ideal para aquellos que desean expandir su huerto y aumentar su capacidad de producción. Este sistema le permite conectar múltiples unidades de huertos hidropónicos, lo que le brinda l');
